import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expenseDate = new Date(2022,9,16);
    const expenseTitle = 'Car Insurance'
    const expenseAmount = 294.67;

    const expenses = [
        {date: new Date(2022,9,16), title: 'Car Insurance', amount: 293.12},
        {date: new Date(2022,9,12), title: 'React Course', amount: 12.12},
        {date: new Date(2022,9,11), title: 'Grocery', amount: 122.12}
    ];
  return (
    <div>
      <h2>Let's get started!</h2>
        <ExpenseItem title={expenses[0].title} date={expenses[0].date} amount={expenses[0].amount}/>
        <ExpenseItem title={expenses[1].title} date={expenses[1].date} amount={expenses[1].amount}/>
        <ExpenseItem title={expenses[2].title} date={expenses[2].date} amount={expenses[2].amount}/>
    </div>
  );
}

export default App;
